import React from 'react'
import JobListing from './ListingUtils/JobListing'

const Listings = () => {
    const data =[
        {
            title: "job1",
            description: "dfhdfh",
            tags: ["Java", "CSS"], 
            expiry: "10 days left",
            price: "123",
            count: "9"
        },
        {
            title: "job1",
            description: "dfhdfh",
            tags: ["Java", "CSS"], 
            expiry: "6 days left",
            price: "123",
            count: "10"
        },

    ]
  return (
    <div>
        {data.map((element) => {
                return <JobListing element={element} />
            })}
    </div>
  )
}

export default Listings
